import React, { useState } from 'react';
import { 
    StyleSheet, 
    SafeAreaView, 
    Button, 
    View,
    Text,
    TouchableOpacity
} from 'react-native';

import Modal from 'react-native-modal';

function CustomerHome() {


    return (
        <SafeAreaView style={styles.container}>
            
            <View style={styles.tble}>

            </View>
            
            <TouchableOpacity
                style={styles.JOIN_WAITLIST}
                onPress={() => console.log("clicked")}
            >
                <Text>JOIN</Text>
            </TouchableOpacity>

            <Modal isVisible='false'>
                <Text>Hello</Text>
            </Modal>

        </SafeAreaView>  
    );
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      justifyContent: 'flex-end',
    },

    JOIN_WAITLIST: {
        width: '80%',
        height: 100,
        bottom: 20,
        backgroundColor: 'dodgerblue',
        justifyContent: 'center',
        alignItems: 'center',
        alignSelf: 'center'
    },

    tble: {
        bottom: 40,
        alignSelf: 'center',
        width: '80%',
        height: '70%',
        backgroundColor: 'gray'
    }

});

export default CustomerHome;
